import React from 'react'
import DarkLightToggle from './DarkLightToggle'
//import signature_black from './images/signature_black.png'
//import signature_White from './images/signature_White.png'

function Heder() {
  return (
    <div className='flex flex-row-reverse justify-between m-10'>
        <div className='flex flex-row-reverse space-x-10 space-x-reverse'>
            <DarkLightToggle></DarkLightToggle>
        </div>
        <div className='bg-sigLight dark:bg-sigDark w-16 h-10 '></div>
  </div>
  )
}


export default Heder
